import React, { useState } from 'react';
import { Settings, Sliders, X, Plus } from 'lucide-react';
import FeedCard from './FeedCard';

const CATEGORY_OPTIONS = [
  'Graduated',
  'Newly Created',
  'About To Graduate',
  'Smart Wallet Behavior',
  'Volume',
  'Market Cap',
  'Holder Growth',
  'Retracement',
  'Token Age',
  'Meta Signal',
  'Social Signal',
  'Custom Strategy',
];

export default function SectionCard({
  category,
  tokens,
  filters,
  onCategoryChange,
  onAddFilter,
  onOpenSettings,
  onRemoveFilter,
  onDuplicate,
  onClearFilters,
  onSaveStrategy,
  onLoadStrategy,
  onTokenClick,
  buyAmount,
}) {
  const [settingsOpen, setSettingsOpen] = useState(false);
  const [categorySelectOpen, setCategorySelectOpen] = useState(false);

  return (
    <section className="flex flex-col bg-zinc-900/80 rounded-2xl border border-zinc-800 shadow-xl backdrop-blur-xl min-h-[80vh] max-h-[82vh] transition-all duration-300 w-[260px]">
      {/* Header */}
      <header className="sticky top-0 z-10 bg-zinc-900/90 backdrop-blur border-b border-zinc-800 rounded-t-2xl flex items-center justify-between px-3 py-2 select-none">
        <span className="text-base font-semibold text-white capitalize truncate max-w-[120px]">{category}</span>
        <div className="flex items-center gap-2">
          <button className="text-zinc-400 hover:text-blue-400 transition" onClick={() => setSettingsOpen(true)}>
            <Settings size={18} />
          </button>
          <button className="text-blue-400 hover:text-green-400 transition relative">
            <Sliders size={16} />
            {filters && filters.length > 0 && (
              <span className="absolute -top-1 -right-1 bg-green-500 text-white text-[10px] rounded-full px-1.5 py-0.5 font-bold">{filters.length}</span>
            )}
          </button>
        </div>
      </header>
      {/* Filter tags/chips */}
      <div className="flex flex-wrap gap-1 px-3 py-2 min-h-[28px]">
        {filters && filters.length > 0 ? (
          filters.map((f, i) => (
            <span key={i} className="bg-blue-900/40 text-blue-200 px-2 py-0.5 rounded-full text-xs font-semibold flex items-center gap-1">
              {f.label || f.summary || f.category}
              <button className="ml-1 text-zinc-400 hover:text-red-400" onClick={() => onRemoveFilter(i)}><X size={12} /></button>
            </span>
          ))
        ) : (
          <span className="text-zinc-500 text-xs">No filters</span>
        )}
      </div>
      {/* Token feed/cards */}
      <div className="flex-1 flex flex-col gap-3 overflow-y-auto token-scrollbar px-2 py-3" style={{ minHeight: 200, maxHeight: '70vh' }}>
        {tokens && tokens.length > 0 ? (
          tokens.map((token, idx) => (
            <FeedCard key={token.name + idx} {...token} buyAmount={buyAmount} onClick={() => onTokenClick(token)} />
          ))
        ) : (
          <div className="flex flex-col items-center justify-center h-40 text-zinc-500 text-base font-semibold gap-2">
            <span>No tokens match your filters.</span>
          </div>
        )}
      </div>
      {/* Settings Modal */}
      {settingsOpen && (
        <div className="fixed inset-0 z-50 flex items-center justify-center bg-black/40 backdrop-blur-sm">
          <div className="bg-zinc-900/95 border border-blue-500/20 rounded-2xl shadow-2xl p-6 min-w-[320px] max-w-[95vw] flex flex-col gap-4 relative">
            <button className="absolute top-3 right-3 p-2 rounded-full hover:bg-zinc-800 transition" onClick={() => setSettingsOpen(false)}><X size={20} /></button>
            <div className="font-bold text-lg text-blue-300 mb-2">Section Settings</div>
            {/* Change Category */}
            <div>
              <label className="font-semibold text-blue-200 mb-1 block">Change Category:</label>
              <select
                className="w-full bg-zinc-800 text-blue-300 rounded px-3 py-2 mt-1"
                value={category}
                onChange={e => { onCategoryChange(e.target.value); setSettingsOpen(false); }}
              >
                {CATEGORY_OPTIONS.map(opt => <option key={opt} value={opt}>{opt}</option>)}
              </select>
            </div>
            {/* Add Filter */}
            <button className="w-full py-2 rounded-lg bg-gradient-to-r from-blue-500 to-green-500 font-bold text-white shadow hover:scale-105 transition-all flex items-center justify-center gap-2" onClick={onAddFilter}><Plus size={16} /> Add Filter</button>
            {/* Save/Load/Duplicate/Clear */}
            <div className="flex flex-col gap-2 mt-2">
              <button className="w-full py-2 rounded bg-zinc-800 text-blue-200 font-semibold hover:bg-blue-900/30 transition" onClick={onSaveStrategy}>Save as Template</button>
              <button className="w-full py-2 rounded bg-zinc-800 text-blue-200 font-semibold hover:bg-blue-900/30 transition" onClick={onLoadStrategy}>Load Saved Strategy</button>
              <button className="w-full py-2 rounded bg-zinc-800 text-blue-200 font-semibold hover:bg-blue-900/30 transition" onClick={onDuplicate}>Duplicate Section</button>
              <button className="w-full py-2 rounded bg-zinc-800 text-red-300 font-semibold hover:bg-red-900/30 transition" onClick={onClearFilters}>Clear Filters</button>
            </div>
          </div>
        </div>
      )}
    </section>
  );
}
